  false,\n\t\"url\": null,\n\t\"notes\": \"During the week of 10-17 June 1983 we camped
  on the west side of the King Salmon River, near its mouth on Ugashik Bay, in an
  effort to observe and collect specimens of the Alaska population of Marbled Godwit
  (Limosa fedoa), which occurs nowhere else in Alaska as a nesting bird. During our
  brief stay we also took notes on all species of birds observed.\",\n\t\"license_title\":
